import React from "react";

const DateInput = ({ name, value, onChange, required }) => {
  return (
    <div>
      <label htmlFor={name}>{name}</label>
      <input
        type="date"
        className="form-control"
        id={name}
        name={name}
        value={value}
        onChange={onChange}
        required={required}
      />
    </div>
  );
};

export default DateInput;

